import { NextApiRequest, NextApiResponse } from 'next';

export default function getAllEvents(
  req: NextApiRequest,
  res: NextApiResponse
) {
  //method là mấy cái GET, PUT, POST, DELETE
  res.json({ hello: 'world', method: req.method });
}
